package com.ccclubs.util;

import java.util.regex.Matcher;
import java.util.regex.Pattern;

import com.ccclubs.config.SYSTEM;
import com.lazy3q.web.helper.$;

public class Test {
 
	/**
	 * @param args
	 */
	public static void main(String[] args) {
		
		//String string = "";
		
		String string = "";
		
		String strRegex = "(((?:c[D|N]){288,384})|((?:[w|c|h][D|N]){144}))*";
		
		Pattern compile = java.util.regex.Pattern.compile(strRegex);
		
		Matcher matcher = compile.matcher(string);
		
		int count = 0;
		while(matcher.find()){
			$.trace(matcher.groupCount(),matcher.group(2),matcher.group(3));
			count++;
		}
		
		$.trace(count);
	};

}
